import React from 'react';
import './App.css';
import Card from 'react-bootstrap/Card';

class RecomCourse extends React.Component {
	render() {
		return (
			<React.Fragment>
				<Card class="m-1 p-0 bg-light rounded">
					<Card.Body >
						<h4 class="mt-0">
							{this.props.data.number}: {this.props.data.name}
						</h4>
						<p style= {{display: (this.props.interests != "") ? "block":"none"}}>
							Recommend this because you have gave high rating to course(s) with keyword(s): <br></br>
							{this.props.interests}
						</p>

						<p style= {{display: (this.props.wishList.length != "")? "block":"none"}}>
							Recommend this because this course is : <br></br>
							{this.props.wishList}
						</p>
					</Card.Body>
				</Card>

			</React.Fragment>
		)
	}
}

export default RecomCourse;
